  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0000439 includes chemical,
  meteorological, physical and underway - surface data collected from LILLOOET in
  the Coastal Waters of SE Alaska, Coral Sea, Cordell Bank National Marine Sanctuary,
  Gulf of the Farallones National Marine Sanctuary, Hawaiian Islands Humpback Whale
  National Marine Sanctuary, Monterey Bay National Marine Sanctuary, North Atlantic
  Ocean, North Pacific Ocean, Olympic Coast National Marine Sanctuary, Papahanaumokuakea
  Marine National Monument, South Pacific Ocean and Tasman Sea from 1988-02-04 to
  1988-02-20 and retrieved during cruise Lill452s, Lill453n, Lill458s, Lill463n, Lill465n,
  Lill469n, Lill473n, Lill475n, Lill479n, Lill481n, Lill483n, Lill485n, Lill487n,
  Lill489n.txt, Lill491n, Lill493n, Lill494s and Lill495n. These data include AIR
  TEMPERATURE - DRY BULB, AIR TEMPERATURE - WET BULB, BAROMETRIC PRESSURE, CARBON
  DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide, RELATIVE HUMIDITY,
  SALINITY, SEA SURFACE TEMPERATURE and WIND SPEED. The instruments used to collect
  these data include gas chromatograph. These data were collected by C. S. Wong of
  Institute of Ocean Sciences - Sidney; Climate Chemistry Laboratory as part of the
  Lillooet, Vancouver to Australia Cruises, 1983-1988 data set.nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
